fn read_fastq_sequences(file_path: &str) -> Vec<Vec<u8>> {
    let reader = fastq::Reader::new(BufReader::new(File::open(file_path).unwrap()));
    let mut sequences = Vec::new();
    for result in reader.records() {
        let record = result.unwrap();
        sequences.push(record.seq().to_vec());
    }
    sequences
}
