use std::collections::HashMap;
use petgraph::graph::NodeIndex;
use petgraph::visit::EdgeRef;
#[test]
fn test_poa3() {
    let sequences = read_fastq_sequences("/home/jiangchen/project/Jolish/test.fq");
    if sequences.is_empty() {
        eprintln!("No sequences found in the FASTQ file.");
        return;
    }
    let u = b"GATCTACCCATGTGGTTGCCTCCATGAATAGTGTGCTTTTGGTAGTGCTGGCCCGGCCTAAACACCATTAGCTAGAGCATTGGTGCATGCCCCCTGCCTGC";
    let p = b"GGTTACCCATGTGGTTGCCTCCATGAATAGTGTGCTTTTGGTAGTGCTGGCCCGGCCTAAACACCATTAGCTAGAGCATTGGTGCATGCCCCCTGCCTGC";
    let scoring = Scoring::new(-1, 0, |a: u8, b: u8| if a == b { 3 } else { -4 });
    let mut aligner = Aligner::new(scoring, &sequences[0]);
    for sequence in &sequences {
        aligner.global(sequence).add_to_graph();
    }

    let consensus = aligner.consensus();
    aligner = Aligner::new(scoring, &consensus);
    aligner.global(u).add_to_graph();
    aligner.global(p).add_to_graph();

    let graph = aligner.graph();
    let mut edge_weights: HashMap<(NodeIndex<u32>, NodeIndex<u32>), usize> = HashMap::new();
    let total_edges = graph.edge_count();

    // Calculate edge weights
    for edge in graph.edge_references() {
        let source = NodeIndex::new(edge.source().index() as usize);
        let target = NodeIndex::new(edge.target().index() as usize);
        let weight = edge_weights.entry((source, target)).or_insert(0);
        *weight += 1;
    }

    // Filter edges based on weight
    let threshold = (total_edges as f64 * 0.2).ceil() as usize;
    let mut corrected_graph = graph.map(|_, n| *n, |_, e| *e);
    for edge in graph.edge_references() {
        let source = NodeIndex::new(edge.source().index() as usize);
        let target = NodeIndex::new(edge.target().index() as usize);
        let weight = edge_weights.get(&(source, target)).unwrap();
        if *weight < threshold {
            // Replace low weight edges with consensus sequence
            corrected_graph.remove_edge(edge.id());
        }
    }

    // Reconstruct corrected sequence
    let mut corrected_sequence = Vec::new();
    let mut current_node = NodeIndex::new(0);
    while let Some(next_edge) = corrected_graph.edges(current_node).next() {
        corrected_sequence.push(corrected_graph[next_edge.target()]);
        current_node = next_edge.target();
    }

    println!("Corrected Sequence: {:?}", corrected_sequence);

    println!("Dot graph:\n{:?}", Dot::new(&corrected_graph));
}
